import OneCard from "./OneCard"

function cardsList(props) {
    if (props.cards.length === 0) {
        return (
            <div>
                <h2>No options</h2>
            </div>
        );
    }

    return (
        <div className="cardsList">
            <ul>
                {props.cards.map((card) => {
                    return (<OneCard Question={card.Question} Options={card.Options} />);
                })}
            </ul>
        </div>
    );
}

export default cardsList;
